import React from 'react'

const defaultProps = {
    backgroundImage: (!this.props.backgroundImage ? "https://mdbootstrap.com/img/Photos/Others/architecture.jpg" : this.props.backgroundImage),
}

export default class Container extends React.Component {
    render () {
        return (
            <div className="jumbotron" style={{backgroundImage: `url('${defaultProps.backgroundImage}')`, color: '#000000'}}>
                <div className="container">
                    <h2 className="display-3 text-center">{this.props.title}</h2>
                </div>
            </div>
        )
    }
}
